import React from 'react';
import { connect } from 'react-redux';

import CollectionOverview from '../../collections/collection-overview/CollectionOverview'

//COMES FROM SELECTOR
import { selectShopCollection } from '../../../redux/reducers/selectors-And-card.utils/shopSelectors'
import { createStructuredSelector } from 'reselect';


const ShopPage = ({ collections }) => {

    return (
      <div className='shop-page'>
        {collections.map(({ id, ...otherCollectionProps }) => (
          <CollectionOverview key={id} {...otherCollectionProps} />
        ))}
      </div>
    );
}


const mapStateToProps = createStructuredSelector({
  collections: selectShopCollection
}) 
export default connect(mapStateToProps)(ShopPage);
